package typify
package labelled

trait Renamer[T <: Tuple, K1, K2] {
  type Out
  def apply(t: T): Out
}

sealed trait RenamerLP {
  final type Aux[T <: Tuple, K1, K2, Out0] = Renamer[T, K1, K2] { type Out = Out0 }

  final given tailRenamer[H, T <: Tuple, K1, K2, V](using t: Renamer[T, K1, K2] { type Out <: Tuple }): Aux[H *: T, K1, K2, H *: t.Out] =
    new Renamer[H *: T, K1, K2] {
      type Out = H *: t.Out
      def apply(l: H *: T): Out = l.head *: t(l.tail)
    }
}

